import React from 'react'

import logo from './logo.png'

function TopNav() {
  return (
    <div>
        <div className='top-text'>Cars | Trucks | Damage and End of Life | Boats and Marine | Motorcycles and Scooters | General goods | Buses, Caravans and Motorhomes   </div>
       <div><img src={logo} alt=''/> </div> 




    </div>
  )
}

export default TopNav
